import React, {Fragment} from 'react';

class Drawer extends React.Component {
    render() {
        return (
            <Fragment>
                <div className="drawer">
                    <header>
                        <nav>
                            <a href="">Inicio</a>
                            <a href="">Explorar</a>
                            <a href="">Radio</a>
                        </nav>
                    </header>
                </div>
            </Fragment>
        );
    }
}
export default Drawer;
